import './App.css';
import { Route, Routes } from "react-router-dom";
import Homepage from './Pages/Homepage';

function App() {
  return (
    <div className="App"> 
    <Routes>

    </Routes>
      <Route path='/' element={<Homepage/>}/>
      <Route path='/chats' element={<ChatPage/>}/>
    </div>
  );
}

export default App;
